package com.wdu.dto;

public class MyObj {

	private String myName;
	private String myFriendName;
	private String myLectureName;
	
	
	
	public MyObj() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getMyName() {
		return myName;
	}
	public void setMyName(String myName) {
		this.myName = myName;
	}
	public String getMyFriendName() {
		return myFriendName;
	}
	public void setMyFriendName(String myFriendName) {
		this.myFriendName = myFriendName;
	}
	public String getMyLectureName() {
		return myLectureName;
	}
	public void setMyLectureName(String myLectureName) {
		this.myLectureName = myLectureName;
	}
	
	
}
